webpackJsonp([0x7dc1b62c440cdc00],{"./node_modules/json-loader/index.js!./.cache/json/python-string-find-method.json":function(n,t){n.exports={data:{markdownRemark:{html:"<h2>String Find Method</h2>\n<p>There are two options for finding a substring within a string in Python, <code>find()</code> and <code>rfind()</code>.</p>\n<p>Each will return the position that the substring is found at. The difference between the two is that <code>find()</code> returns the lowest position, and <code>rfind()</code> returns the highest position.</p>\n<p>Optional start and end arguments can be provided to limit the search for the substring to within portions of the string.</p>\n<p>Example:</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-shell\"><code>>>> string = \"Don't you call me a mindless philosopher, you overweight glob of grease!\"\n>>> string.find('you')\n6\n>>> string.rfind('you')\n42</code></pre>\n      </div>\n<p>If the substring is not found, -1 is returned.</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-shell\"><code>>>> string = \"Don't you call me a mindless philosopher, you overweight glob of grease!\"\n>>> string.find('you', 43)  # find 'you' in string anywhere from position 43 to the end of the string\n-1</code></pre>\n      </div>\n<p>More Information:</p>\n<p>String methods <a href='https://docs.python.org/3/library/stdtypes.html#string-methods' target='_blank' rel='nofollow'>documentation</a>.</p>",fields:{slug:"/python/string-find-method/"},frontmatter:{title:"String Find Method"}}},pathContext:{slug:"/python/string-find-method/"}}}});
